import React from 'react';

interface props {
    name: () => void;
    price: number;
}

function ShopItem({name, price}:props) {
    return(
        <div className="ShopItem">
            <h4>{name}</h4>
            <div>{price}원</div>
        </div>
    );
}

export default ShopItem;
